import React, { useState } from 'react';

import Slider from '@mui/material/Slider';

function SliderChanger(props){
    const [value, setValue] = useState(Number(props.value));
    const options = props.options;
    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    const sendChange = () => {
        props.onValueChange([props.keyHistory, value]);
    }
    return(
    
            
            <Slider sx={{width: '90%'}} valueLabelDisplay="on" value={value} min={options.min} max={options.max} step={options.step} marks={options.marks} track={options.track} onChange={handleChange} onChangeCommitted={sendChange}></Slider>

        )

}

export default SliderChanger;
